                                                            <div class="h3YV2d">
                                                                I hate to say it but the art is distractingly bad. The matches all look like coneheads. The stories are interesting from what I've played but there's almost no content! The
                                                                game says I am out of characters but I've only matched with 8 and all the stories available are incomplete. Similar to Lovelink but a fraction of the content available.
                                                                Lovelink and MeChat are better games of this style. I hope this game improves. Also no way in game to contact support!
                                                            </div>
